בשבועות הקרובים תצביע הכנסת על דרישתי לחקור את שערוריית הפקרת משאבי הטבע שלנו לטייקונים. היום אנחנו רואים עוד הצלחה של כי״ל לכופף את המדינה - לחציה ריככו עוד יותר את המלצות ועדת ששינסקי 2. שימו לב לכמה דברים שיקרו לכסף שלכם:
• במקום להעלות את התמלוגים של משאבי ים המלח מ-10% יורידו אותם, ריאלית, לפחות מ-5%;
• רווחי הפוספטים לא ימוסו בצורה ראויה;
• צומצם מס רווחי היתר על משאבי הטבע (שממילא  מאפשר תכנוני מס וקשה לגבייה);
• לא יוטלו תמלוגים על מים מינרלים (שהחברות רוכשות במחיר מוזל של מים לתעשייה);
רשימת האבסורדים היא ארוכה. רשימת השאלות - לא פחות (כולל שאלת העלויות הסביבתיות של ההפקה שנופלות על הציבור הרחב). 
אבל לשאלה אחת של יאיר לפיד, הולכת ומסתמנת תשובה: איפה הכסף.
